import React from "react";

const DashBoard = () => {
  return (
    <div className="container">
      <div className="row">
        <div className="col-sm-3">
          <div className="sideBar">
            <div className="title">HYPE</div>
            <div className="sbContent">Side Bar</div>
          </div>
        </div>
        <div className="col-sm-9">
          <div className="row">
            <div className="topBar">Top Bar</div>
          </div>
          <div className="row">
            <div className="main">
              <Main></Main>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default DashBoard;
